    }

    login = event
    render() {
        return(
            <div>
                <h1>Login</h1>
                <label>
                    Username:
                    <input type="text" name="username"/>
                </label>
                <br/>
                <label>
                    Password:
                    <input type="text" name="password"/>
                </label>
                <br/>
                <button onClick={Login}>Login</button>
            </div>
        );
    }
    
}
